import axios from 'axios';

const URL = "http://localhost:3000";

export function postCsv(csv) {
  return axios.post(`${URL}/csv_file`, csv).then(response => response)
    .catch((error) => error);
}

export function getImages(batch_id) {
	return axios.get(`${URL}/pictures/${batch_id}`)
}
